import React from "react";
import './VideoFooter.css'

const VideoFooter=()=>{
    return(
        <div className="videoFooter">
            <div className="videoFooterText">
                <h3>Aesthetic ocean</h3>
                <p>Peaceful ocean edit</p>
            </div>
        </div>
    )
}
export default VideoFooter
